import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import About from "./routes/About";

function App() {
  return (
    <div className="App">
      <h1> Hellooo</h1>
      <BrowserRouter></BrowserRouter>
      <Routes>
        <Route exact Path="/about" element={<About />}></Route>
      </Routes>
    </div>
  );
}

export default App;
